        if (B - A) // 2 % 2 == 0:
            return 0 ^ B
        else:
            return 1 ^ B
    elif A % 2 == 0:
        if (B - A + 1) // 2 % 2 == 0:
            return 0
        else:
            return 1
    elif B % 2 == 0:
        if (B - A - 1) // 2 % 2 == 0:
            return 0 ^ A ^ B
        else:
            return 1 ^ A ^ B
    elif (B - A) // 1 % 2 == 0:
        return 0 ^ A
